import { Link } from "react-router-dom";

const Navbar = ({user}) =>{
  return(
    <div className="navbar">
      <span className="logo">
        <Link className="link" to ="/"> Dani App</Link></span>

        user ? () 



      <ul className="list">
          <li className="listItem">
            <img src="https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcRYGS7BdzW6SjENdL6TEcPOn-uGEbdPSL6w2WLzoP4WbePoacMbPjsmlmbSvzeebdVIXLM&usqp=CAU" alt="" className="avatar" />
          </li>
          <li className="listItem">Tatah Test</li>
          <li className="listItem">Logout</li>
      </ul>

    </div>
  )
}

export default Navbar;
